import React from 'react'
import ExploreCard from './ExploreCard/ExploreCard'
import './ExplorePage.css'
function SearchPage() {
    return (
        <div className="explorePage">
            {/* <h4>Skills</h4>  */}
            <ExploreCard icon="https://www.youtube.com/img/explore/destinations/icons/trending_color_64.png" title="Experience" />
            <ExploreCard icon="https://image.flaticon.com/icons/png/512/5252/5252970.png" title="Skills" />
            <ExploreCard icon="https://image.flaticon.com/icons/png/512/2683/2683274.png" title="Projects" />
            <ExploreCard icon="https://www.youtube.com/img/explore/destinations/icons/trending_color_64.png" title="Education" />
        </div>
    )
}

export default SearchPage
